import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Creacion from "./pages/creacion";

const ListadeTareas = () => {
  const tareas = ['Pagina TP N°10', 'Pagina Kayak', 'Pagina React-Native'];

  return (
    <div>
      <h1>Lista de Tareas</h1>
      <ul>
        {tareas.map((task, index) => (
          <li key={index}>{task}</li>
        ))}
      </ul>
      <Link to="./pages/creacion">Crear Nueva Tarea</Link>
    </div>
  );
};

const CrearTareas = () => {
  return (
    <div>
      <h1>Crear Nueva Tarea</h1>

    </div>
  );
};

const App = () => {
  return (
    <Router>
      <Routes>
        {}
        <Route path="/" element={<ListadeTareas />} />
        {}
        <Route path="./pages/creacion" element={<CrearTareas />} />
      </Routes>
    </Router>
  );
};

export default App;
